package com.example.instiutoBackend.model;

import com.sun.istack.NotNull;
import lombok.AllArgsConstructor;
import lombok.Data;
import lombok.NoArgsConstructor;

import javax.persistence.*;

@Entity
@Table(name = "imagenes")
@Data
@NoArgsConstructor
@AllArgsConstructor
public class Archivo {

    @Id
    @GeneratedValue(strategy = GenerationType.IDENTITY)
    private Long idArchivo;

    private String nombre;

    private String foto;

    public Archivo setFotoUsuarioDefault() {
        Archivo foto = new Archivo();
        foto.setNombre("Foto-Usuario-Default");
        foto.setFoto("data:image/png;base64,");
        return foto;
    }

    public Archivo setFotoCursoDefault() {
        Archivo foto = new Archivo();
        foto.setNombre("Foto-Curso-Default");
        foto.setFoto("data:image/jpeg;base64,");
        return foto;
    }

}
